    [],nt"revision_timestamp": "2015-09-26T21:23:22.536219",nt"name": "noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-mississippi-wfo-",nt"isopen":
    false,nt"url": null,nt"notes": "This digital elevation model (DEM) is a
    part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
    Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
    The DEMs created for this project were developed using the NOAA National Weather
    Service's Weather Forecast Office (WFO) boundaries. The DEM includes the best available
    lidar known to exist at the time of DEM creation that meet project specifications
    for the Mississippi WFO which includes the coastal counties of Harrison, Hancock,
    and Jackson. The DEM is derived from LiDAR datasets collected by the U.S. Geological
    Survey (USGS) and the U.S. Army Corps of Engineers (USACE) and others from 2001
    to 2007. Please see the Supplemental Information field for specific information
    about the lidar data sets used. Hydrographic breaklines used in the creation of
    the DEM were obtained from the National Hydrography Dataset (NHD). The DEM is hydro
    flattened such that water elevations are less than or equal to 0 meters. The DEM
    is referenced vertically to the North American Vertical Datum of 1988 (NAVD88) with
    vertical units of meters and horizontally to the North American Datum of 1983 (NAD83).
    The resolution of the DEM is approximately 10 meters.",nt"license_title": null,nt"extras":
